import React, { Component } from "react";
import { connect } from "react-redux";

import {
  NavbarLeftStyle,
  LogoContainer
} from "../../assets/components/layout/Navbar.style";
import logo from "./../../assets/images/logo.png";

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      active: true
    };
  }

  showMenu() {
    this.setState({
      active: !this.state.active
    });
  }

  render() {
    return (
      <div>
        <NavbarLeftStyle className={this.state.active ? "active" : "inactive"}>
          <LogoContainer>
            <img src={logo} alt="logo entreprise" />
          </LogoContainer>
        </NavbarLeftStyle>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {};
};

export default connect(
  mapStateToProps,
  null
)(Navbar);
